// src/pages/CoursePage.js
import React from 'react';
import CourseCard from '../components/CourseCard';

function CoursePage() {
  return (
    <div>
      <h1>Our Courses</h1>
      <CourseCard title="Course 1" description="Learn React" />
      <CourseCard title="Course 2" description="Learn JavaScript" />
    </div>
  );
}

export default CoursePage;
